import React from "react";
import { Button } from "../Button/Button";
import styles from "./Header.module.css"

export const Header = () => {
  return (
    <div className={styles["header__wrap"]}>
        <div className={styles["header-content__wrap"]}></div>
      <Button text="Add worker" />
    </div>
  );
};
